import React, { Component } from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';


class Test extends Component {
  render() {
    return (
      <div>
        <Router>
          <div>

            <Route path="/test/" component={Test} />
          </div>
        </Router>
      </div>
    );
  }
}


export default Test;
